  String someKeyPrefix = "someKey";
  String someValuePrefix = "someValue";

  
  someProperties = new Properties();
  for (int i = 0; i < 10; i++) {
    someProperties.setProperty(someKeyPrefix + i, someValuePrefix + i);
  }

